        <UserContext.Consumer>
            { user => {
                this.meuUser = user
                return (
                    <div>
                        <ButtonAppBar />
                        <p>ola mundo {this.meuUser.getName()}</p>
                    </div>
                )
            }}


        </UserContext.Consumer>


    )
}








